import React from 'react'
import {useLocation, useNavigate} from "react-router-dom"

const ImagePage = () => {
    const location = useLocation()
    const image = location.search.split()
    return(
        <div>
            
             <button onClick={()=>navigate(-1)}>Go Back</button>
        </div>
        
    )
}

export default ImagePage
